apiVersion: operators.coreos.com/v1alpha1
kind: ClusterServiceVersion
metadata:
  annotations:
    capabilities: Basic Install
    categories: AI/Machine Learning
    description: |-
      Fabric-for-Deep-Learning
    containerImage: docker.io/ffdlops/ffdl:v0.0.1
    repository: https://github.com/adrian555/ffdl-operator
    support: IBM
    createdAt: 2019-04-01T08:00:00
    alm-examples: |-
      [{}]
  name: ffdl-operator.v0.0.1
  namespace: local
spec:
  apiservicedefinitions: {}
  customresourcedefinitions:
    owned:
    - kind: FfDL
      name: ffdls.openaihub.ibm.com
      version: v1alpha1
      displayName: FfDL operator
      description: |-
        FfDL
  description: Placeholder description
  displayName: Ffdl Operator
  icon:
  - base64data: 
    mediatype: image/png
  install:
    spec:
      clusterPermissions:
      - rules:
        - apiGroups:
          - '*'
          resources:
          - '*'
          verbs:
          - '*'
        serviceAccountName: ffdl-operator
      deployments:
      - name: ffdl-operator
        spec:
          replicas: 1
          selector:
            matchLabels:
              name: ffdl-operator
          strategy: {}
          template:
            metadata:
              labels:
                name: ffdl-operator
            spec:
              containers:
              - env:
                - name: WATCH_NAMESPACE
                  valueFrom:
                    fieldRef:
                      fieldPath: metadata.namespace
                - name: POD_NAME
                  valueFrom:
                    fieldRef:
                      fieldPath: metadata.name
                - name: OPERATOR_NAME
                  value: ffdl-operator
                image: ffdlops/ffdl:v0.0.1
                imagePullPolicy: Always
                name: ffdl-operator
                resources: {}
              serviceAccountName: ffdl-operator
    strategy: deployment
  installModes:
  - supported: true
    type: OwnNamespace
  - supported: true
    type: SingleNamespace
  - supported: false
    type: MultiNamespace
  - supported: true
    type: AllNamespaces
  maturity: alpha
  provider:
    name: IBM
  links:
  - name: FfDL
    url: https://github.com/IBM/FfDL
  keywords:
  - FfDL
  version: 0.0.1
  maintainers:
  - name: Weiqiang Zhuang
    email: wzhuang@us.ibm.com
